    super(props);
    this.state ={
      breakT: 0,
      sessionT: 15
    }
    //this.

  }

  render() {
    return(
      <div>
        <Timeset />
        <div>{this.state.sessionT}</div>
      </div>
    )
  }
}


export default Clock;
